import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { useNavigate } from "react-router-dom";

import {
    Alert,
    Button,
    ImageBackground,
    Modal,
    Pressable,
    SafeAreaView,
    TextInput
} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

const onClick = (event) => {

    event.preventDefault();
    if (user === "Buyer") {
        const newUser = {
            email: email,
            pass: Bpass,
        };

        axios
            .post("/backend/user/login", newUser)
            .then((response) => {
                if ((response.data) != null) {
                    var em = localStorage.getItem("Uemail");
                    if (em) {
                        localStorage.removeItem("Uemail");
                    }
                    localStorage.setItem("Uemail", email);

                    navigate("/profileUser");
                }
                else {
                    alert("Wrong email or password ");

                }
                console.log(response.data);
            })
            .catch(function (error) {
                alert(error);
            });
    }
    else if (user === "Vendor") {
        const newVendor = {
            email: Vemail,
            pass: Vpass,
        };

        axios
            .post("/backend/vendor/login", newVendor)
            .then((response) => {
                if ((response.data) != null) {
                    var em = localStorage.getItem("Vemail");
                    if (em) {
                        localStorage.removeItem("Vemail");
                    }
                    localStorage.setItem("Vemail", Vemail);
                    var v = localStorage.getItem("vid");
                    if (v) {
                        localStorage.removeItem("vid");
                    }
                    // console.log(response.data._id);
                    localStorage.setItem("vid", response.data._id);

                    navigate("/profileVendor");
                }
                else {
                    alert("Wrong email or password ");

                }
                // console.log(response.data);
            })
            .catch(function (error) {
                alert(error);
            });
    }

    resetInputs();
};
function ReviewDetails(props) {
    const { patient } = props;
    const navigate = useNavigate();

    return (
        <View style={styles.card}>
            <View style={styles.cardContent}>
                <Text>Name : {patient.PATIENT_NAME}</Text>
            </View>
            <View style={styles.cardContent}>
                <Text>PatientID : {patient.P_ID}</Text>
            </View>
            <View style={styles.cardContent}>
                <Text>Age : {patient.AGE}</Text>
            </View>
            <View style={styles.cardContent}>
                <Text>Gender : {patient.GENDER}</Text>
                <Text style={styles.buttonOpen}>
                    <Pressable>
                        <Icon.Button
                            // name="profile"
                            style={styles.buttonOpen}
                            onPress={() => { onClick }}
                        >
                            Assessment
                        </Icon.Button>
                    </Pressable>
                </Text>
            </View>

            {/* <View style={styles.cardContent}>
                <Text>Date of Admission : {patient.date}</Text>
            </View> */}
            {/* <View style={styles.cardContent}>
                <Text>Dime of Admission : {patient.time}</Text>
            </View> */}
        </View>
    );
}

const styles = StyleSheet.create({
    card: {
        borderRadius: 6,
        elevation: 3,
        backgroundColor: '#fff',
        shadowOffset: { width: -2, height: -3 },
        shadowColor: '#333',
        shadowOpacity: 1,
        shadowRadius: 2,
        marginHorizontal: 4,
        marginVertical: 6,
    },
    cardContent: {
        marginHorizontal: 18,
        marginVertical: 8,
    },
    buttonOpen: {
        alignContent: 'center'
    }
});

export default ReviewDetails;
